      SELECT - + col0 + + col0 + + ( 53 ) * col2 AS col0 FROM tab1 (FORMAT parquet) WHERE - + 96 * + - col2 * + + col0 / 65 * - - col1 + col1 - 11 IS NULL;
  - name: tab1

outputs:
  - name: q5142.out
    data: |
